<script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

</script>

    return paddingObj.top + "px " + paddingObj.right + "px " + paddingObj.bottom + "px " + paddingObj.left + "px";

        cel.style.right = pad.right + "px";
        cel.style.bottom = pad.bottom + "px";
        cel.style.left = pad.left + "px";
        el.style.width = "100%";
        el.style.height = "100%";

      // we will make an output binding object that delegates to the
      // definition. This is because we foolishly used the same method
      // name (renderValue) for htmlwidgets definition and Shiny bindings

      // bindings receive data that includes lots of metadata that it
      // strips off before calling htmlwidgets renderValue). We can't
      // just ignore the difference because in some widgets it's helpful
      // to call this.renderValue() from inside of resize(), and if

      // version instead of the htmlwidgets version.

      delegateMethod(shinyBinding, bindingDef, "getId");

          // Shiny can call resize before initialize/renderValue have been
          // called, which doesn't make sense for widgets.
          if (elementData(el, "initialized")) {

  var scheduleStaticRenderTimerId = null;

  // Render static widgets after the document finishes loading
  // Statically render all elements that are of this widget's class

          // app, but the widget itself is not a Shiny output, but
          // rather a simple static widget. One example of this is

          // flips slides between display:none and display:block.
          // Ideally we would not have to have ioslide-specific code
          // here, but rather have ioslides raise a generic event,
          // but the rmarkdown package just went to CRAN so the
          // window to getting that fixed may be long.
          if (window.addEventListener) {

            // browsers because ioslides itself only supports
            // such browsers.
            on(document, "slideenter", resizeHandler);
            on(document, "slideleave", resizeHandler);
          }

        var scriptData = document.querySelector("script[data-for='" + el.id + "'][type='application/json']");
        if (scriptData) {
          var data = JSON.parse(scriptData.textContent || scriptData.text);
          // Resolve strings marked as javascript literals to objects
          if (!(data.evals instanceof Array)) data.evals = [data.evals];

          evalAndRun(data.jsHooks.render, initResult, [el, data.x]);

        } else if (typeof(length) !== "undefined" && length !== df[name].length) {

        }

    }

  // Split value at splitChar, but allow splitChar to be escaped
  // using escapeChar. Any other characters escaped by escapeChar

  function splitWithEscape(value, splitChar, escapeChar) {

    var currentResult = "";

          results.push(currentResult);
          currentResult = "";

          escapeMode = true;
        } else {
          currentResult += value[pos];

    postRenderHandlers.push(callback);

  // to rewrite all the logic in this file to accomodate both
  // types of definitions.
  function createLegacyDefinitionAdapter(defn) {
    var result = {
      name: defn.name,
      type: defn.type,
      initialize: function(el, width, height) {
        return defn.factory(el, width, height);
      },
      renderValue: function(el, x, instance) {
        return instance.renderValue(x);
      },
      resize: function(el, width, height, instance) {
        return instance.resize(width, height);
      }
    };

    if (defn.find)
      result.find = defn.find;
    if (defn.renderError)
      result.renderError = defn.renderError;
    if (defn.clearError)
      result.clearError = defn.clearError;

    return result;
  }
})();

<style type="text/css">
img.leaflet-tile {
padding: 0;
margin: 0;
border-radius: 0;
border: none;
}
.info {

font: 14px/16px Arial, Helvetica, sans-serif;
background: white;
background: rgba(255,255,255,0.8);
box-shadow: 0 0 15px rgba(0,0,0,0.2);
border-radius: 5px;
}
.legend {
line-height: 18px;
color: #555;
}
.legend svg text {
fill: #555;
}
.legend svg line {
stroke: #555;
}
.legend i {
width: 18px;
height: 18px;
margin-right: 4px;
opacity: 0.7;
display: inline-block;
vertical-align: top;

*display: inline;
}

-webkit-transition: -webkit-transform 0.3s ease-out, opacity 0.3s ease-in;
-moz-transition: -moz-transform 0.3s ease-out, opacity 0.3s ease-in;
-o-transition: -o-transform 0.3s ease-out, opacity 0.3s ease-in;

}
.leaflet-cluster-spider-leg {

-webkit-transition: -webkit-stroke-dashoffset 0.3s ease-out, -webkit-stroke-opacity 0.3s ease-in;
-moz-transition: -moz-stroke-dashoffset 0.3s ease-out, -moz-stroke-opacity 0.3s ease-in;

}

<style type="text/css">.marker-cluster-small {
background-color: rgba(181, 226, 140, 0.6);
}
.marker-cluster-small div {
background-color: rgba(110, 204, 57, 0.6);
}
.marker-cluster-medium {
background-color: rgba(241, 211, 87, 0.6);
}
.marker-cluster-medium div {
background-color: rgba(240, 194, 12, 0.6);
}
.marker-cluster-large {
background-color: rgba(253, 156, 115, 0.6);
}
.marker-cluster-large div {
background-color: rgba(241, 128, 23, 0.6);
}

.leaflet-oldie .marker-cluster-small {
background-color: rgb(181, 226, 140);
}
.leaflet-oldie .marker-cluster-small div {
background-color: rgb(110, 204, 57);
}
.leaflet-oldie .marker-cluster-medium {
background-color: rgb(241, 211, 87);
}
.leaflet-oldie .marker-cluster-medium div {
background-color: rgb(240, 194, 12);
}
.leaflet-oldie .marker-cluster-large {
background-color: rgb(253, 156, 115);
}
.leaflet-oldie .marker-cluster-large div {
background-color: rgb(241, 128, 23);
}
.marker-cluster {
background-clip: padding-box;
border-radius: 20px;
}
.marker-cluster div {
width: 30px;
height: 30px;
margin-left: 5px;
margin-top: 5px;
text-align: center;
border-radius: 15px;
font: 12px "Helvetica Neue", Arial, Helvetica, sans-serif;
}
.marker-cluster span {
line-height: 30px;
}</style>

<script type="application/json" data-for="htmlwidget-bcca19a45052ec805a84">{"x":{"options":{"crs":{"crsClass":"L.CRS.EPSG3857","code":null,"proj4def":null,"projectedBounds":null,"options":{}}},"calls":[{"method":"addTiles","args":["//{s}.tile.openstreetmap.org/{z}/{x}/{y}.png",null,null,{"minZoom":0,"maxZoom":18,"tileSize":256,"subdomains":"abc","errorTileUrl":"","tms":false,"noWrap":false,"zoomOffset":0,"zoomReverse":false,"opacity":1,"zIndex":1,"detectRetina":false,"attribution":"&copy; <a href=\"http://openstreetmap.org\">OpenStreetMap<\/a> contributors, <a href=\"http://creativecommons.org/licenses/by-sa/2.0/\">CC-BY-SA<\/a>"}]},{"method":"addAwesomeMarkers","args":[[49.2914842270099,49.4690011651281,49.3077133545613,49.3272878334305,49.6177744092491,49.1916630728166,49.4308052413633,49.4236159552262,49.5849728866044,49.4804829091138,48.8985731763998,49.3058626921992,49.4894910677722,49.2525972993266,49.3814232604742,49.3311911559352,49.2045053713154,49.215540904524,49.2294245680122,49.2458460767463,49.1916630728166,49.1916630728166,49.2027671482266,49.2723176477198,49.5765847445765,49.5415089521336,49.257326388832,49.2302108008397,49.2744066148473,49.4326168734397,49.1983489460578,49.2292554942243,49.4394415682637,49.5766496547657,49.275486780652,49.3154900191232,49.4162571104018,49.4245218632031,49.310241783074,49.2920453866714,49.2697449998721,49.1916630728166,49.4250720949435,49.2545820410169,49.5642962380358,49.3048926086537],[2.46149044723784,1.90761229887603,2.60295215043445,2.39984879170279,2.2207125408752,2.1859107961009,2.0764834040573,1.88677167502018,2.94393745439801,1.86953497863755,2.2581532057345,2.79891976942788,2.80530483065262,2.39484440605052,2.45749780485017,2.4630435438528,2.36223811189846,2.59169642524373,2.27582218208849,2.12965121364355,2.1859107961009,2.1859107961009,2.39873763906901,2.48810818800062,2.99859004116095,2.75055645210524,2.47787939160024,2.90647230076821,2.48436581888907,2.71736633329654,2.51402373227328,2.13183081194816,2.86161543397813,3.01122924228318,2.47504553055064,2.32639871711152,2.80239201748714,2.09594624688288,2.68268708878265,2.44805852493881,2.47582645977134,2.1859107961009,2.11100928426767,2.45681703498169,2.990587523649,2.58606613733885],{"icon":"home","markerColor":"red","iconColor":"black","spin":false,"squareMarker":false,"iconRotate":0,"font":"monospace","prefix":"glyphicon"},null,"BASOL",{"interactive":true,"draggable":false,"keyboard":true,"title":"","alt":"","zIndexOffset":0,"opacity":1,"riseOnHover":false,"riseOffset":250},["<span class=\"marine\"><\/span>","<span class=\"marine\">L'enfouissement de déchets industriels banals, c'est-à-dire assimilables à des ordures ménagères, avait été autorisé dans la décharge d'HODENC en BRAY. Cependant, au début des années 70, des déchets industriels autres que ceux prévus y ont été admis.<\/span>","<span class=\"marine\">L'usine Salpa, fermée en 1977, a engendré un dépôt de déchets de cuir et de plastique d'environ 13 000 tonnes.<br><br>\r\nEn 2012, un des transformateurs contenant potentiellement des PCB encore présent sur le site a été vandalisé.<br><br><\/span>","<span class=\"marine\">En 1976, des déchets industriels liquides ont été déversés dans cette décharge en infraction avec les mesures imposées. L'exploitant a été mis en demeure par arrêté préfectoral du 26 octobre 1976 de remettre en état le site et de contrôler la nappe souterraine. Les liquides ont été pompés.<\/span>","<span class=\"marine\">Ancienne carrière de craie phosphatée, en partie à ciel ouvert, en partie souterraine. En 1975, des déchets industriels liquides ont été déversés dans la partie à ciel ouvert et des fûts de déchets industriels ont été stockés dans les galeries souterraines. <\/span>","<span class=\"marine\">L'existence de l'ancienne décharge LOUYOT a été portée à la connaissance de l'Inspection des Installations Classées au début de l'année 1992, par les représentants de la municipalité.<br><br>\r\nLa Société LOUYOT, reprise depuis par la Société COMPTOIR LYON ALEMAND LOUYOT, est réputée avoir exploité le site jusqu'au début des années 1960 pour y enfouir des déchets industriels tels des réfractaires usés provenant de ses fours de fusion. Elle était spécialisée dans la fabrication de métaux non ferreux à base essentiellement de Cuivre, de Nickel ou de Zinc.<br><br>\r\nAujourd'hui, le site est un talus naturel remblayé sur lequel une végétation arbustive s'est implantée.<\/span>","<span class=\"marine\">Site en zone urbaine, bordé par deux rus afflents de la rivière Le Thérain. Il est à l'état de friche herbeuse ou boisée.<br>\r\nCe site est séparé par un ru d'un autre site également pollué suite aux activités de l'ancienne usine à gaz de Beauvais. L'usage de ce second site étant de plus différent (implantation des installations actuelles EDF et de GDF à Beauvais), il fait l'objet d'une autre fiche.<\/span>","<span class=\"marine\">Cette ancienne carrière d'argile a été en partie comblée par des déchets bitumeux. La végétation s'est en partie implantée sur la couverture de terre et de déblais apportée sur les dépôts. Une surveillance piézométrique est assurée.<\/span>","<span class=\"marine\">Le site de Suzoy est une ancienne carrière de matériaux silico-calcaires qui a été utilisée tout d'abord comme décharge d'ordures ménagères. Elle a ensuite reçu plusieurs milliers de tonnes de déchets issus de l'unité RHONE POULENC à RIBECOURT (boues de stations d'épuration, déchets barytiques).<br><br>\r\nCette décharge (réglementée par arrêté préfectoral du 27 décembre 1985) a cessé son activité en 1990.<\/span>","<span class=\"marine\">À la fin de l'année 1974, après plusieurs procès-verbaux dressés à l'encontre des exploitants successifs ayant tous des liens <br>\r\njuridiques, financiers ou familiaux entre eux, de l'inspection des installations classées et de la gendarmerie, l'activité de la <br>\r\ndécharge de déchets industriels de VILLEMBRAY cessait. Dès cette époque, deux campagnes de mesures à cet effet, effectuées <br>\r\npar les sapeurs pompiers de Beauvais d'une part, et par l'APAVE à AMIENS d'autre part, n'avaient pas mis en évidence de <br>\r\nmanifestation radioactive.<br><br>\r\nPar la suite, diverses mesures furent prescrites, tant pour améliorer la connaissance des effets des dépôts sur l'environnement <br>\r\nque pour renforcer la sécurité du site. En particulier, l'arrêté préfectoral du 28 avril 1984 a instauré à la charge de la société <br>\r\nSEIC, propriétaire du site et détentrice des déchets enfouis, un suivi analytique de la qualité des eaux souterraines, et a <br>\r\ninstauré des servitudes destinées à prévenir toute intervention pouvant compromettre la situation des dépôts. Le Tribunal <br>\r\nAdministratif n'a pas accédé à la demande d'annulation présentée par la SEIC pour cet acte.<br><br>\r\nLes carences répétées des détenteurs des déchets, en dernier lieu Mme BEN CHETRIT, fille du dirigeant de la SEIC, ont donné <br>\r\nlieu à plusieurs procès-verbaux et mises en demeure préfectorales. Finalement, l'exécution d'office des travaux nécessaires, <br>\r\naux frais de Mme BEN CHETRIT, a été confiée à l'ADEME. Il s'agissait notamment d'analyser les eaux superficielles et <br>\r\nsouterraines, les émanations gazeuses, de mesurer la radioactivité et de réaliser une étude hydrogéologique complète du site. <br>\r\nLe montant des travaux s'est élevé à environ 1 MF.<br>\r\nles suivis périodiques de la qualité des eaux souterraines et superficielles au droit du site sont assurés par l'ADEME par arrêté de travaux d'office du 16 septembre 2010.<br>\r\nUne forte dégradation des ouvrages piézométriques a été constaté en mars 2011. L'ADEME a reconfiguré le suivi piézométrique en suivant la qualité des eaux souterraines sur la base des piézométres utilisables. Cette alternative  présente plusieurs avantages : en terme de cout de mise en uvre et d'intérêts techniques et scientifique du suivi. Les piézométres utilisés ont les mêmes caractéristiques que ceux abandonnés.<br><\/span>","<span class=\"marine\">Ancienne lagune dont la création est antérieure à 1940 et ayant reçu jusqu'en 1975 les eaux résiduaires de la plate-forme chimique suivies du dépôt des déchets solides de la station d'épuration et de l'usine.<br>\r\nL'exploitant a cessé toute activité sur le site depuis 1999.<br><\/span>","<span class=\"marine\">Le site a été exploité entre 1960 et 1998 par différentes sociétés<br>\r\nsuccessives qui ont développé la même activité de recyclage d'aluminium<br>\r\npar fusion.<br><\/span>","<span class=\"marine\">La Société STARE a exploité à VILLERS SUR COUDUN un atelier de traitement de surface à l'origine d'une contamination par du chrome hexavalent de l'eau du captage de VILLERS SUR COUDUN (en 1980).<br><br>\r\nEn 1988, la société META MECA est devenue l'exploitant des installations.<br><br>\r\nEn septembre 1989, l'exploitation des installations a cessé.<br><br><\/span>","<span class=\"marine\">Sur un site de 37 ha environ, traversé par la rivière Le Thérain, la société ADCLO exploitait des installations de fabrication d'huisseries métalliques, de revêtement de tôles d'acier et de traitement chimique des métaux.<br><br>\r\nAprès l'arrêt des activités en 1984, des déchets divers ont été délaissés sur le site (fûts et bidons contenant des peintures, solvants,...). Des actes de malveillance ont également entrainé des déversements d'huiles et de PCB.<br><\/span>","<span class=\"marine\">La société IDEAL STANDARD a exercé sur le site jusqu'en 1996 des activités de traitement de surfaces de robinetterie et tuyauterie flexible pour installations sanitaires.<br>\r\nLa société espagnole DISFLEX devient gérante du site en juillet 1996 puis la rachète en 1997 (déclaration en préfecture du 19/03/98). Le site et les bâtiments ont été divisés et vendus à plusieurs sociétés.<br>\r\nCompte tenu des importantes modifications qui ont eu lieu sur le site tant au niveau de l'activité que des installations la société DISFLEX a déposé un dossier de demande de régularistation de la situation administrative.<br>\r\nUn arrêté préfectoral en date du 01/04/2004 régularise cette société.<br><\/span>","<span class=\"marine\">Le site de Liancourt a accueilli une usine fabriquant du gaz à partir de la distillation de la houille. Actuellement, il est utilisé pour les besoins d'EDF/GDF.<\/span>","<span class=\"marine\">Le terrain est situé au centre ville. Il a une superficie denviron 1823 m² et a accueilli de 1907 à 1933 une usine fabriquant du gaz à partir de la distillation de la houille. Les installations de lusine ont été démantelées. Le gazomètre a été détruit en 1969.<br>\r\nLusine na jamais été exploitée par Gaz de France.<br><br>\r\nActuellement, la partie ouest du site est aménagée en habitation avec jardin dagrément et potager pour un agent d'EDF/GDF.<br><\/span>","<span class=\"marine\">Le site actuellement propriété de EDF - Gaz de France est constitué par un terrain d'une surface de 7 997 m2 se trouvant 300 mètres au Sud du centre ville de Senlis. L'autorisation préfectorale pour l'établissement d'une usine à gaz à Senlis date du 19 janvier 1866. <br><br>\r\nL'usine à gaz a cessé son activité dans les années 1960. Les trois gazomètres et les bâtiments des fours ont été démantelés. Seuls persistent actuellement de l'ancienne usine, deux bâtiments d'habitation (non utilisés) et des remises. Le site est à l'heure actuelle désaffecté. Les seules interventions des agents EDF- Gaz de France sur le site sont liées à un poste de coupure EDF, à un poste de transformation haute tension et à un détendeur gaz.<\/span>","<span class=\"marine\">Le site est constitué par un terrain d'une superficie de 2 590 m2 se trouvant à 300 mètres au Sud-Est du centre de ville de Neuilly-en-Thelle. La date de construction de l'usine à gaz n'est pas connue. La production de gaz de houille a été réalisée sur le site jusqu'en juillet 1957. Après 1957, le site a été reconverti en station d'air propané utilisant une partie des anciennes structures de l'usine à gaz. Le site est à l'heure actuelle à l'état de friche.<\/span>","<span class=\"marine\">Friche industrielle constituée de trois zones :<br>\r\n- la première, dite \"secteur 1\", de surface 6 ha, sur laquelle se trouvaient les installations de production maintenant démantelées ;<br>\r\n- la deuxième, dite \"secteur 2\" de surface 1 ha, renferme un dépôt de carbure de calcium et un dépôt de sables de fonderie ;<br>\r\n- la troisième, dite \"zone agricole\" de surface 4 ha, n'a pas été le siège d'activités industrielles ; elle est mise en culture.<\/span>","<span class=\"marine\">L'établissement est situé dans une zone en voie d'urbanisation. Différents bâtiments y ont été utilisés en particulier pour des opérations de traitement de surface. Des métaux lourds ont été mis en évidence dans le sous-sol de deux d'entre eux. Ces bâtiments ont été démolis au début de l'année 2002.<\/span>","<span class=\"marine\">Le site est localisé sur la commune de BORNEL-Hameau de Montagny La Poterie. Le site est situé dans une zone d'habitats dispersés à la cote NGF +95 m.La rivière \"Esches\", classée en 1ère catégorie piscicole est située à environ 2 km au Nord-Est du site.Le niveau piézométrique de la nappe piézométrique des sables du Thanétien se situe à la cote NGF +58,5 m, soit à une profondeur de l'ordre de +37 m NGF par rapport au terrain naturel du site.Les premiers captages AEP sont situés en aval hydraulique du site à environ 2km.Il s'agit d'un ancien atelier de traitement de surface dont les premières activités ont débutées en 1973.Différents exploitants se sont succédés sur ce site dont les sociétés ont fait l'objet de liquidations judiciaires successives.La société ST MEDARD ETERNUM est devenue propriétaire du site à la fin de l'année 1996.<\/span>","<span class=\"marine\">Des activités de teinturerie ont été exercées sur le site de Gouvieux en bordure de lOise par plusieurs sociétés successives et en dernier lieu par la société SITO. Le site a fermé en 2000, année où la société SITO a été placée en liquidation judiciaire.<br><br>\r\nDes prélèvements et analyses ont été réalisés entre 2002 et 2009 pour caractériser létat de pollution du site. En vue dexaminer la possibilité dun nouvel usage pour ce site, une étude sanitaire a été réalisée début 2009.<\/span>","<span class=\"marine\">Les activités de la société EURAND ont été autorisées par larrêté préfectoral du 2 mars 1984. <br>\r\nLes activités sur ce site ont cessé définitivement en juillet 2011.<\/span>","<span class=\"marine\">Les activités de RIGIDA sur ce site consistaient en la fabrication de jantes de vélo en aluminium.<br><br>\r\nLes activités ont définitivement cessé en octobre 2009. La liquidation judiciaire de la société RIGIDA a été prononcée par le Tribunal de Commerce de Compiègne le 18 septembre 2009. Un mémoire de cessation dactivité réalisé par lAPAVE a été transmis à la Préfecture de lOise par le liquidateur judiciaire, Maître Herbaut, en avril 2010.<\/span>","<span class=\"marine\">Yoplait a exercé sur ce site des activités de fabrication de produits laitiers entre 1914 et 2006.<br>\r\nLa cessation d'activité a été notifiée en 2008<\/span>","<span class=\"marine\">Ancienne usine de traitement de déchets de métallurgie (zinc, plomb) de 1837 à 1992, dont le sol et le sous-sol sont pollués. Début 2000, l'exploitant a démoli l'ensemble des bâtiments et évacué les déblais, ne laissant que les plate-formes des bâtiments et le mur d'enceinte.<br><\/span>","<span class=\"marine\">SODIMATEX était spécialisée dans la fabrication darticles non tissés à destination du secteur automobile et soumise à autorisation. La notification de cessation dactivités a été transmise au Préfet de lOise en octobre 2010. Les activités ont définitivement cessé le 31 décembre 2010.<br><br>\r\nLes usines U3 et U246 de SODIMATEX sont implantées dans le Parc dActivités « Les Portes du Valois » en périphérie de la commune de Crépy-en-Valois.<br><br>\r\nLenvironnement du site est caractérisé par :<br>\r\n- A lEst, à 50 m : des sites industriels puis des champs agricoles à partir de 500 m ;<br>\r\n- Au Nord, en limite de propriété : des sites industriels puis à 400 m une voie SNCF, et à 700 m, des quartiers résidentiels ;<br>\r\n- A lOuest, à 100 m : des habitations ;<br>\r\n- Au Sud-Ouest, à 500 m : des champs agricoles, un stade et des établissements scolaires ;<br>\r\n- Au Sud, à 50 m : des sites industriels.<br><\/span>","<span class=\"marine\">La société Lorge&amp;Cie était spécialisée dans les opérations de démontage, démolition, récupération de métaux. Cétait également une station de transit de déchets, de résidus et d'appareil usagés provenant notamment d'ICPE contenant, imprégnés ou souillés de fluides diélectriques chlorés (PCB).<br><br>\r\nLactivité sur ce site a débuté en 1969.<br><br>\r\nLenvironnement du site est caractérisé par :<br>\r\n-\tà lEst : la route nationale N16 ;<br>\r\n-\tau Nord : une route puis un complexe sportif (stade et centre nautique) ;<br>\r\n-\tà lOuest et au Sud : des habitations (pavillons et immeubles).<br>\r\nLa superficie totale du site est de 22 000 m2<br><\/span>","<span class=\"marine\">Lentreprise RIETER exploitait sur ce site des installations de production de pièces acoustiques à base de composites fibreux destinées aux secteurs poids lourds, tracteurs et ferroviaires.<br><br>\r\nLes activités ont définitivement cessé en août 2010.<br><br>\r\nLe site de Rémy relevait du régime de la déclaration au regard de la législation relative aux Installations Classées pour la Protection de lEnvironnement. Lexploitant disposait dun récépissé de déclaration en date du 26 août 1994.<br>\r\nL'exploitant avait déposé un dossier de régularisation administrative de ses activités en 2005 compte-tenu de l'évolution des activités du site. Le site était classé sous le régime de l'autorisation pour les rubriques 2661-1 et 2940-2. Cependant il n'y a pas eu d'arrêté préfectoral d'autorisation pour le nouveau régime de l'établissement.<br><br><\/span>","<span class=\"marine\">La société POLYTITAN a exploité sur le territoire de la commune de Vineuil Saint Firmin, des installations classées soumises à autorisation entre 1957 et 2006. Le site était spécialisé dans la fabrication dadditif pour lindustrie du PVC.<br><br>\r\nLa cessation dactivité du site date de 2006. La liquidation judiciaire a été prononcée le 18 juillet 2006.<br><br>\r\nLe site est bordé : <br>\r\n-au nord, par la RD 924 puis des terres agricoles ;<br>\r\n-à louest, par une zone boisée ;<br>\r\n-au sud, par la Nonette (affluent de lOise) puis par les locaux de lancienne usine SOPAL. Ce site est actuellement est cours de transformation dans le cadre dun projet dhôtellerie ;<br>\r\n-à lest, par des terres agricoles.<br><br>\r\nLes premières maisons de la commune de Vineuil-Saint-Firmin sont situées à environ 300 m à louest du site.<br><br><br>\r\nLe site exploité par la société Polytitan occupe une surface de 1,17 ha à lest de la commune de Vineuil.<br><br>\r\nLe bâti est composé de 9 bâtiments (dont un à usage de bureaux) pour lesquels la surface varie de 110 à 570 m².<br><\/span>","<span class=\"marine\">Le présent rapport concerne la cessation dactivités du site AGORA ex Force 5 à Meru. Le site Force 5 est une coopérative agricole qui comportait 3 silos de 75 000 litres. Les activités ont définitivement cessé en août 2010.<br><br>\r\nLe site est localisé entre la zone industrielle de Méru et le centre ville. <br>\r\nLenvironnement du site est caractérisé par :<br>\r\n- A lEst : une voie ferrée et au-delà des habitations individuelles ;<br>\r\n- Au Nord : une rue et au-delà des habitations ;<br>\r\n- A lOuest : une rue et au-delà un centre commercial et des immeubles dhabitations collectives ;<br>\r\n- Au Sud : lancien site de la fonderie Norinco.<br><br>\r\nLe site sinscrit en zone UM au Plan Local dUrbanisme (soit zone urbaine mixte de renouvellement urbain, accueillant de lhabitat, des activités et des équipements publics). Il nest pas classé en zone inondable.<br><\/span>","<span class=\"marine\">Usine de fabrications de pneumatiques, jusqu'en 2009.<br>\r\nLe site, représentant une superficie de 16,17 ha, est localisé à Clairoix, dans la zone urbaine à vocation dactivités industrielles entre : <br>\r\n-la rivière Oise à lest, <br>\r\n-la voie de chemin de fer à louest (liaison Compiègne  Saint Quentin) <br>\r\n-la route départementale RD 81 au nord.<br><br>\r\nLétablissement se situe à environ 3,8 km au nord-est du centre de Compiègne. Les habitations les plus proches se situent à moins de 50 m du site<\/span>","<span class=\"marine\">La fonderie est installée à Noyon depuis 1899. Le site occupe 6 ha à proximité de la gare de Noyon.<br><br>\r\nL'activité du site était la fonderie de bronze pour la robinetterie avant la première guerre mondiale puis la fonderie de fonte à partir des années 1920 (production de baignoires en fonte émaillée de la marque Jacob Delafon).<br><br>\r\nL'activité du site a cessé en 2006.<\/span>","<span class=\"marine\">La société Montupet a exploité sur le site de Nogent sur Oise des installations de fonderie de l'aluminium pour le marché automobile jusqu'en 2006.<br><br>\r\nLe site s'étend sur environ 35 000 m² et les bâtiments occupent une surface de 23 000 m².<\/span>","<span class=\"marine\">L'usine ZF Sachs suspension France à Mouy avait une activité de fabrication de suspensions pour l'industrie automobile.<br><br>\r\nLe site d'environ 4,5 ha est situé au sud du centre-ville de Mouy. Il est bordé :<br>\r\n- Au nord, par un petit cours deau, lEvêque, puis par une industrie,<br>\r\n- A lest, par une voie ferrée puis par une zone boisée limitée par un ruisseau le Thérain,<br>\r\n- Au sud, par une zone boisée traversée par un petit cours deau puis par une industrie,<br>\r\n- A louest, par la D929 (avenue du 11 novembre) puis par des habitations.<br><br>\r\nLa production a cessé en août 2009.<\/span>","<span class=\"marine\">La société PENOX SA, qui exploitait des installations de fabrication d'oxydes de plomb depuis 1911, était spécialisée dans la fabrication de litharge de plomb (PbO - rouge ou jaune en fonction de la température d'oxydation du plomb), de minium de plomb (Pb3O4) à partir de litharge, de plombate de calcium, de silicate de plomb et de litharge à haute teneur en plomb (L.H.T.P).<br><br>\r\nLe site est maintenant fermé et a fait l'objet d'une cessation d'activité.<br><br><br><\/span>","<span class=\"marine\">Site ayant exercé une activité de négoce de produits chimiques comprenant pour l'essentiel des peroxydes organiques.<\/span>","<span class=\"marine\">Usine de fabrication d'accessoires pour l'automobile, de dispositifs pour systèmes de freinage notamment. De l'amiante y a été mise en oeuvre de 1992 à 1996 pour produire des matériaux de friction.<br><br>\r\nLe site est localisé à environ 1,2 km au Sud-Est du centre-ville de Beauvais, à environ 450 m au Sud-Est de la gare ferroviaire et à environ 200 m au Nord de la rivière Le Thérain.<\/span>","<span class=\"marine\">Le site d'Isollex occupe une superficie totale de 14 664 m² dont 2880 m² de surface couverte. Le terrain accueille un bassin à ciel ouvert de 40 m3 pour la récupération des eaux de pluie.<br><br>\r\nAprès de nombreuses interventions de l'inspection des installations classées et plusieurs arrêtés préfectoraux de suspension d'activité, la société Isollex a été mise en liquidation judiciaire en janvier 2004.<br><\/span>","<span class=\"marine\">Le site a accueilli de 1900 à 1920 une usine de lampes à arc. En 1921 la société Desnoyers, y a installé une unité de production de tubes en acier. Cette unité est passée sous le contrôle de la société Vallourec en 1969. L'activité a cessé en septembre 2004.<br><br>\r\nLes bâtiments présents sur le site occupent une surface de 22000 m3, le reste du terrain étant couvert par les voiries et des espaces boisés.<br>\r\nL'établissement la limite de propriété Est du site est matérialisé par la voie de chemin de fer reliant Paris à Amiens.<br>\r\nDes maisons et jardins individuels délimitent l'établissement à l'ouest et au sud.<br>\r\nLa rivière Brèche se trouve à 300 m à l'est du site<br>\r\nAu niveau du site, la nappe alluviale ne se situe qu'à quelques mètres de profondeur.<\/span>","<span class=\"marine\">Ancienne usine de métallurgie comprenant notamment des activités de fonderie, trempe et recuit de métaux ainsi que des dépôts de liquides inflammables.<br>\r\nLors de la cessation d'activité en 1991 l'exploitant, qui n'existe plus aujourd'hui, a laissé le site en l'état sans le dépolluer.<br>\r\nEn 1994 la société S.A. HLM LA SABLIERE a acquis ces terrains en vue d'y construire des logements sociaux.<br><\/span>","<span class=\"marine\">Les bâtiments ayant été démantelés, le site d'implantation des installations de l'ancienne usine CLAL, rue Gambetta à <br>\r\nBORNEL, se présente sous forme de friche. Il est situé en zone urbanisée. La rivière Esches le traverse.<br><br><\/span>","<span class=\"marine\">Le site se présente maintenant comme une friche industrielle. Ancien dépôt de stockage de fioul implanté sur une parcelle de 2765 m² dans laquelle les installations maintenant démantelées occupaient une surface de 430 m². <br>\r\nLe site se trouve quartier de Marissel, à l'Est de la ville de Beauvais, dans un environnement de type industriel. Toutefois des habitations se trouvent à proximité, la plus proche à 30 m à l'Ouest. Il est implanté dans la vallée de la rivière \"Le Thérain\", entre deux ruisseaux, l'un à 200 m au Sud, l'autre à 100 m au Nord.<br>\r\nAu droit du site, la nappe souterraine se trouve à 1 m de profondeur environ, dans les tourbes. Il s'agit de la nappe des formations alluviales, en communication avec celle de la craie, localement exploitée pour l'alimentation publique. Les captages d'alimentation en eau potable de la ville de Beauvais se situent en amont hydraulique, à 3.5 km.  <br><\/span>","<span class=\"marine\">Ancienne usine de traitement de déchets de métallurgie (zinc, plomb) de 1837 à 1992, dont le sol et le sous-sol sont pollués. Début 2000, l\\'exploitant a démoli l\\'ensemble des bâtiments et évacué les déblais, ne laissant que les plate-formes des bâtiments et le mur d\\'enceinte.<br><\/span>","<span class=\"marine\">De 1929 à fin 2003 l'activité sur le site a consisté en la fabrication d'enrobés pour l'industrie automobile en particulier utilisés dans les systèmes de freinage et d'embrayage. Différents produits ont été utilisés sur le site comme le xylène, le trichloéthylène, le perchloréthylène, les peintures, les solvants et l'amiante.<br><\/span>"],null,{"showCoverageOnHover":true,"zoomToBoundsOnClick":true,"spiderfyOnMaxZoom":true,"removeOutsideVisibleBounds":true,"spiderLegPolylineOptions":{"weight":1.5,"color":"#222","opacity":0.5},"freezeAtZoom":false},null,["STOOP","ANCIENNE DECHARGE PERIN","SALPA / HUTCHINSON","DECHARGE DE CAMBRONNE LES CLERMONT","Ancienne décharge SARP à HARDIVILLERS","ANCIENNE DECHARGE LOUYOT","GAZ DE FRANCE parcelle 2","ANCIENNE DECHARGE KELLER","DECHARGE DE SUZOY VAUCHELLES","ANCIENNE DECHARGE DE VILLEMBRAY","DECHARGE INTERNE  RETIA (ex ARKEMA)","VALFOND AFFINAGE ( EX  AFFINAL)","META MECA","ADCLO","DISFLEX FRANCE","Ancienne usine à gaz","Ancienne usine à gaz","Ancienne usine à gaz de Senlis","Ancienne usine à gaz de Neuilly-en-Thelle (60)","Ancienne fonderie NORINCO","SFAM","Société ST MEDARD ETERNUM ( anciennement société MARBA)","SITO","EURAND","RIGIDA","Yoplait france SAS","UMICORE (Vieille montagne)","SODIMATEX","Etablissements Lorge&amp;Cie","RIETER","POLYTITAN","Agora Ex Force 5","CONTINENTAL","Kohler France (ex Jacob Delafon)","MONTUPET","ZF Sachs suspension France (ex Sachs Alliquant)","AKZO NOBEL Chemicals","BOSCH SYSTEMES DE FREINAGE","Isollex","Vallourec","Ex FONDERIES LAFEUILLE","FIMALAC (ancienne tréfilerie CLAL)","ancien dépôt pétrolier TOTAL FINA ELF","VIEILLE MONT
